Talitsa (; , AytÄ±-Kool) is a rural locality (a selo) in Ust-Kansky District, the Altai Republic, Russia. The population was 111 as of 2016. There are 3 streets.
Geography
Talitsa is located 40 km northwest of Ust-Kan (the district's administrative centre) by road. Ust-Kumir is the nearest rural locality.
